import NavBar from "./components/NavBar";
import collections from "./Data.json";

import "./App.css";
import Collection from "./components/Collection";

import { createBrowserRouter } from "react-router-dom";
import CollectionList from "./components/CollectionsList";

createBrowserRouter([{
	path: "/", element: <RootLayout/>,
	children:[{
		path: "/collections:collectionId", element: CollectionList
	}]
}])

function App() {
	return (
	    <main className="main">
      <NavBar />
      {collections.collection.map((collection) => (
        <Collection
          key={collection.id}
          name={collection.name}
          headline={collection.headline}
          info={collection.info}
          image={collection.image} // Just pass the image path
        />
      ))}
    </main>
	);
}

export default App;
